import React, { Component } from 'react';
import './Artwork.css';
import obruc from  '../assets/gridArt/obruc.jpg'

const GridImage = (prop) => {
  return(
    <div class="col-4 grid-image">
      <img src={prop.src} alt={prop.name} height="100px" width="160px" />
      <p className="image-title">{prop.name}</p>
    </div>
  );
}

class Artwork extends Component {
  render() {
    return(
      <div className="artwork">
        <div class="row">
          <GridImage src={obruc} name="P.d. ObruÄ" />
        </div>
      </div>
    );
  }
}

export default Artwork;
